import ReactDOM from "react-dom/client";
import "./style.css"

const root = ReactDOM.createRoot(document.getElementById("root"))

//Creating Navbar component

function Navbar() {
  return (
    <nav>
      <h1>Perfumy</h1>

      <ul>
        <li> Home | </li>
        <li>Products | </li>
        <li><a>About |</a> </li>
        <li><a>Contact |</a> </li>
      </ul>
    </nav>
  )

}

//Creating Search Bar
function Searchbar() {
  return (
    <div class="searchbar">
      <input type="text" placeholder="Search"></input>
    </div>
  )
}

//Creating Products 
<div class="products">

  <div class="box">
    <img src="./images/one.jpg"></img>
    <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
  </div>
  <div class="box">
    <img src="./images/three.jpg" alt="villain"></img>
    <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
  </div>
  <div class="box">
    <img src="./images/two.jpg" alt="Designs Club"></img>
    <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
  </div>
</div>

//Creating About Us

function Aboutus() {
  return (
    <div style="text-align: center;">
      <div class="about" style="margin-top: 10px; text-align: center;">
        <h1>About Us</h1>
        <p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections
          1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact
          original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>
      </div>
    </div>
  )
}

//Creating Footer


root.render(
  <div>
    <Navbar></Navbar>
    <Searchbar></Searchbar>
  </div>
)
